import React from 'react';

 function TextBox(props) {

  const {inputType, placeholder, label, id} = props;
  return (
    <div>
      <label for="formGroupExampleInput2" class="form-label">{props.label}</label>
      <input
        type={inputType}
        class="form-control"
        id={id}
        placeholder={placeholder}
      />
    </div>
  );
}

export default TextBox;
